Here is a basic React app that takes user input, makes an API call, and displays the result in HTML. In this example, we'll use the OpenWeatherMap API to fetch the current weather data for a city.

First, create a new React app using the command line:
npx create-react-app my-app

Next, replace the contents of src/App.js with the following code:
import React, { useState } from "react";

function App() {
  const [city, setCity] = useState("");
  const [weatherData, setWeatherData] = useState(null);

  const handleInputChange = (event) => {
    setCity(event.target.value);
  };

  const handleFormSubmit = async (event) => {
    event.preventDefault();

    const apiKey = "YOUR_API_KEY";
    const apiUrl = `https://api.openweathermap.org/data/2.5/weather?q=${city}&units=metric&appid=${apiKey}`;
    const response = await fetch(apiUrl);
    const data = await response.json();

    setWeatherData(data);
  };

  return (
    <div>
      <h1>Weather App</h1>
      <form onSubmit={handleFormSubmit}>
        <label htmlFor="city">City:</label>
        <input
          type="text"
          id="city"
          name="city"
          value={city}
          onChange={handleInputChange}
        />
        <button type="submit">Get Weather</button>
      </form>
      {weatherData && (
        <div>
          <h2>{weatherData.name}</h2>
          <p>Temperature: {weatherData.main.temp} &deg;C</p>
          <p>Feels like: {weatherData.main.feels_like} &deg;C</p>
          <p>Humidity: {weatherData.main.humidity} %</p>
        </div>
      )}
    </div>
  );
}

export default App;

In the handleFormSubmit function, we make an API call to OpenWeatherMap, passing in the user input (city) and an API key. When the response comes back, we parse the JSON data and store it in the weatherData state variable.

In the return statement, we render a simple form with an input field and a button. When the user submits the form, the handleFormSubmit function is called. If weatherData is not null, we render the weather data returned by the API.

Finally, replace the contents of src/index.js with the following code to render the App component:
import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

ReactDOM.render(<App />, document.getElementById("root"));

Don't forget to replace YOUR_API_KEY with your actual OpenWeatherMap API key.

That's it! Now you should be able to run your app using npm start and see a simple weather app that allows users to search for the weather in different cities.

Sure, here is an example code in Go to decode a JSON file:


```
package main

import (
    "encoding/json"
    "fmt"
    "os"
)

type Person struct {
    Name  string   `json:"name"`
    Age   int      `json:"age"`
    Email []string `json:"email"`
}

func main() {
    file, err := os.Open("people.json")
    if err != nil {
        fmt.Println("Error opening file:", err)
        return
    }
    defer file.Close()

    var people []Person

    decoder := json.NewDecoder(file)
    err = decoder.Decode(&people)
    if err != nil {
        fmt.Println("Error decoding JSON:", err)
        return
    }

    fmt.Println(people)
}
```

In this example, we define a struct Person to match the JSON data. Then, we open the people.json file and use a JSON decoder to read and decode the contents of the file into a slice of Person structs. Finally, we print the resulting slice of Person structs to the console. Note that we use the defer keyword to ensure that the file is closed after we're done reading from it.

